import React from 'react'
import styled from 'styled-components';

const UI = styled.ui`
ul {
    list-style: none;
    display: flex;
    flex-flow: row nowrap;

    li {
      padding: 10px 10px;   
    }

  }
`

const RightNav = () => {
    return (
       <ul>
        <li>Home</li>
        <li>About us</li>
        <li>Contact Us</li>
        <li>Sign In</li>
        <li>Sign Up</li>
      </ul>
    )
}

export default RightNav
